import React from 'react'
import './App.css';
import {makeStyles} from '@mui/styles'
import { Container, IconButton, Paper, Typography } from '@mui/material';
import { width } from '@mui/system';
import InputBase from '@mui/material/InputBase';
import AddIcon from '@mui/icons-material/Add';
import CheckIcon from '@mui/icons-material/Check';
import { useState } from 'react';


const useStyles = makeStyles(theme=>({
    typo:{
      backgroundColor:theme.palette.secondary.main,
      color:'yellow',

    },
    paper:{
      marginTop: theme.spacing(5) ,
      border:'2px solid red',
      [theme.breakpoints.down('sm')]:{
        width:'100%',
        minHeight:'60vh'

      },
      [theme.breakpoints.up('sm')]:{
        width:'40%',
        minHeight:'80vh',


      }
    },
    container:{
      display:'flex',
      justifyContent:'center',
      alignItems:'center',


    },
    inputbase:{
      backgroundColor:'pink',
      display:'flex',
      justifyContent:'center',
      alignItems:'center',
      height:theme.spacing(6)
    },
    iconPlus:{
      display:'flex',
      justifyContent:'center',
      alignItems:'center'
    },
    plus:{
      fontSize: '40px'
    },
    paperDiv:{
      display:'flex',
      justifyContent:'center',
      alignItems:'center'
    },
    item:{
      display:'flex',
      justifyContent:'center',
      alignItems:'center',
    },
    completed:{
      marginRight: theme.spacing(1) ,
    },
    itemButton:{
      display:'flex',
      justifyContent:'center',
      alignItems:'center'
    }
  }))

const Counter = () => {
  const classes = useStyles();
  const [open, setOpen]= useState(false);
  const [item, setItem]= useState('')
  const [data, setData]= useState([])
  const delFun=()=>{
    if(open===true){
    setOpen(false)}
    else if(open===false){
      setOpen(true)
    }
  };
  const iBfun=(e)=>{
    let get = e.target.value;
    setItem(get)
  };

  const getData=()=>{
    setData((preList)=>
      [...preList , item])

  }
  console.log(data)


  return (
    <Container className={classes.container}>
    <div className={classes.paperDiv}>
        <Paper className={classes.paper}>
          <Typography variant='h4' align='center' className={classes.typo}>
            My Task
          </Typography>
          <div className={classes.iconPlus}>
            <InputBase onChange={iBfun} className={classes.inputbase}/>
            <AddIcon onClick={getData} className={classes.plus}/>
          </div>
          <hr />

          {data.length>0?(data.map((element)=> (
              <div className={classes.itemButton}>
            <IconButton>
              <CheckIcon onClick={delFun} className={classes.completed}/>
            </IconButton>
            {(open===false)?(<Typography className={classes.item}>{element}</Typography>): (<Typography className={classes.item}> <del> {element}</del></Typography>) }
          </div>

            )
          )):
          "NO Data Found"


            }


        </Paper>
    </div>
    </Container>
  )}

export default Counter

























